import{_ as t,o,c as a,ah as i}from"./chunks/framework.DA8bEdPh.js";const f=JSON.parse('{"title":"Installation","description":"","frontmatter":{},"headers":[],"relativePath":"getting-started/installation.md","filePath":"getting-started/installation.md"}'),n={name:"getting-started/installation.md"};function r(s,e,l,c,d,h){return o(),a("div",null,[...e[0]||(e[0]=[i('<h1 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to “Installation”">​</a></h1><p>Phenofhy is currently a beta package designed to run inside the Our Future Health TRE. There is no automated installer yet; you must upload the package manually.</p><h2 id="step-1-download-the-package" tabindex="-1">Step 1: Download the package <a class="header-anchor" href="#step-1-download-the-package" aria-label="Permalink to “Step 1: Download the package”">​</a></h2><p>Download a zip of the Phenofhy package from GitHub:</p><p><a href="https://github.com/studiovincentstraub/phenofhy/tree/main/beta/phenofhy" target="_blank" rel="noreferrer">https://github.com/studiovincentstraub/phenofhy/tree/main/beta/phenofhy</a></p><p>Tip: download the entire repository as a zip and just upload <code>phenofhy/</code> folder intact when you upload it to the TRE (do not nest <code>phenofhy</code> in <code>phenofhy/beta/phenofhy</code>).</p><h2 id="step-2-upload-to-the-tre-airlock" tabindex="-1">Step 2: Upload to the TRE (Airlock) <a class="header-anchor" href="#step-2-upload-to-the-tre-airlock" aria-label="Permalink to “Step 2: Upload to the TRE (Airlock)”">​</a></h2><p>Phenofhy must be transferred into the TRE using the Airlock process. The Airlock team will guide you through each stage as the request is processed.</p><p>Summary of the modified ingress route:</p><ol><li>Upload the package to an unrestricted project in the OFH TRE.</li><li>Submit an import request and follow Airlock instructions: <a href="https://dnanexus.gitbook.io/ofh/airlock/importing-files-into-a-restricted-project" target="_blank" rel="noreferrer">https://dnanexus.gitbook.io/ofh/airlock/importing-files-into-a-restricted-project</a></li><li>Airlock performs security checks and transfers files into a restricted project.</li><li>Copy the approved files into your own restricted project and confirm completion.</li></ol><h2 id="step-3-set-config-json" tabindex="-1">Step 3: Set <code>config.json</code> <a class="header-anchor" href="#step-3-set-config-json" aria-label="Permalink to “Step 3: Set config.json”">​</a></h2><p>Phenofhy expects a <code>config.json</code> file in the project helpers directory:</p><ul><li>Location: <code>/mnt/project/helpers/config.json</code></li><li>Purpose: identifies dataset dictionaries, phenotype list files, and base paths.</li></ul><p>A template is included in the package under <code>phenofhy/beta/phenofhy/config.json</code>. Copy it into the TRE helpers directory and update the IDs for your study:</p><ul><li><code>PROJECT_ID</code> and <code>PROJECT_ID_LONG</code></li><li><code>COHORTS</code> entries (for example, <code>FULL_SAMPLE</code> and <code>TEST_COHORT</code>). These can be created using the cohort browser and saving cohort dashboard views; for instructions, see: <a href="https://documentation.dnanexus.com/user/cohort-browser/defining-cohorts" target="_blank" rel="noreferrer">https://documentation.dnanexus.com/user/cohort-browser/defining-cohorts</a></li><li><code>FILES</code> entries for codings and dictionaries, should you wish to save these to file</li></ul><p>You will usually edit this file from a JupyterLab instance in the TRE, but you can also update it locally before uploading. Expect to refresh file IDs over time as datasets and dictionary files are updated.</p><h2 id="after-transfer" tabindex="-1">After transfer <a class="header-anchor" href="#after-transfer" aria-label="Permalink to “After transfer”">​</a></h2><p>Once the package and <code>config.json</code> are in place, you can follow the Quickstart.</p>',18)])])}const u=t(n,[["render",r]]);export{f as __pageData,u as default};
